        public IActionResult Buzdolabı(int aktifSayfaNO=1)
        {
            
            
            BuzdolabıViewModel x = new();

            x.BuzdolabıListesi = _context.Buzdolapları.Skip((aktifSayfaNO - 1) * 20).Take(20).OrderBy(b => b.BuzdolabıID).ToList();
            x.AktifSayfa = aktifSayfaNO;
            //x.SonSayfa = Convert.ToInt32(Math.Ceiling(Convert.ToDecimal(BuzdolabıListesi.Count) / 20m));
            x.SonSayfa = ((_context.Buzdolapları.Count() - (_context.Buzdolapları.Count() % 20)) / 20) + 1;
            x.BaşKayıtNO = ((aktifSayfaNO - 1) * 20) + 1;
            x.SonKayıtNO= x.AktifSayfa==x.SonSayfa ? _context.Buzdolapları.Count() : aktifSayfaNO * 20;
            x.TotalKayıtNO = _context.Buzdolapları.Count();
            return View(x);
        }

        

        [ResponseCache(Duration = 0, Location = ResponseCacheLocation.None, NoStore = true)]
        public IActionResult Error()
        {
            return View(new ErrorViewModel { RequestId = Activity.Current?.Id ?? HttpContext.TraceIdentifier });
        }
